"Společnost OnePlus bude s vaším oprávněním sbírat informace o používání telefonu, aby vylepšovala design produktu a uživatelský zážitek. Pokud souhlasíte s připojením k Programu zlepšování uživatelského zážitku („Program“), pak to značí, že souhlasíte, že společnost OnePlus může sbírat, používat a analyzovat následující informace: 
 (1) Konfigurační údaje;
 (2) Statistické údaje o programu aplikace;
 (3) Údaje o chování uživatelů;
 Sbíráním a analýzou výše uvedených údajů usiluje společnost OnePlus o vylepšování uživatelského zážitku. Všechny postupy jsou společnosti OnePlus odesílány anonymně a šifrovaně, jako např. pomocí vylepšení výkonu baterie a stability systému. Tyto údaje se nebudou používat k žádnému osobně identifikovatelnému rozpoznávání. Poté, co se připojíte k Programu, to můžete kdykoliv zrušit následujícím způsobem: Nastavení – Pokročilé – Program uživatelského zážitku a odškrtnutím pole. Podívejte se prosím na Zásady ochrany osobních údajů společnosti OnePlus, kde můžete zjistit více o informacích zpracovávaných společností OnePlus. Poté, co zrušíte svou účast v Programu, společnost OnePlus přestane sbírat výše zmíněné informace."
